  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Benton Lake,
  Willow Creek, Pishkun National Wildlife Refuge outlines Refuge accomplishments from
  September through December of 1960. The report begins by summarizing the weather
  conditions, habitat conditions, water conditions, and food and cover during this
  period. Wildlife- including migratory birds, upland game birds, big game animals,
  and predators and fish- is also covered. The Refuge development and maintenance
  section discusses physical developments and prescribed burning. Resource management
  is outlined; topics include grazing and haying. A progress report on field investigations
  and applied research is also provided. N-R forms and photographs are attached.\",\n\t\"license_title\":
